import { joinFrom } from './../util/joinFrom';
import { UserTypes } from './../../../collab-db-postgresql/src/types';
import { ApolloDatabaseUser } from './../resolvers';
import { Document } from './Document';
import { Context } from '../resolvers';
import { NewUserInput, User as ApolloUser } from './../../../../types/resolvers-types';
import { Base } from './Base';
import { createEntity } from '../entity';
import logger, { Tags } from '../../../../shared/log/logger';

export class User extends Base<
  ApolloDatabaseUser,
  ApolloUser,
  {
    documents: Document[];
  }
> {
  constructor(user: ApolloDatabaseUser, from: string, context: Context) {
    super({
      name: 'User',
      entity: user,
      from,
      context,
      getters: {
        documents: async () => {
          const result = (await context.resolvers.Query.documents({ userId: user.id })).map((d) => new Document(d, this.id, joinFrom(from, 'getters.documents'), context))
          return result;
        }
      }
    });
  }

  async removeDocument(docId: string) {
    const doc = await Document.buildFromId(docId, this.id, 'User.removeDocument', this.context);
    const member = (await doc.resolveAsEntity())?.members?.find(m => m.user.id === this.id);
    const userDocMember = (await this.context.resolvers.Query.documentMembers({ ids: [member.id] }))?.[0];
    return await this.context.resolvers.Mutation.deleteDocumentMember(userDocMember.id);
  }

  static async buildFromId(id: string, from: string, context: Context): Promise<User> {
    const user = await context.resolvers.Query.user(id);
    const userObject = new User(user, joinFrom(from, `User.buildFromId(${id})`), context);
    return userObject;
  }

  static async buildFromEmail(email: string, from: string, context: Context): Promise<User> {
    const user = await context.resolvers.Query.userWithEmail(email);
    const userObject = new User(user, joinFrom(from, `User.buildFromEmail(${email})`), context);
    return userObject;
  }

  static async create(input: Omit<NewUserInput, 'createdAt' | 'updatedAt'>, from: string, context: Context) {
    let type = input.type;
    if (!type) {
      if (!input.userName) {
        type = UserTypes.Anonymous;
      } else {
        type = UserTypes.Standard;
      }
    }
    const user = await createEntity<ApolloUser, 'documents'>({
      ...input,
      type
    });
    logger.debug(`New User Entity created:`, { tag: Tags.ENTITY, meta: user });
    await context.resolvers.Mutation.addUser(user);
    const newUser = new User(user, joinFrom(from, 'User.create'), context);
    return newUser;
  }
}
